import React, { useState } from 'react';

const FeatureRow = ({ feature, values }) => (
  <div className="grid grid-cols-7 gap-4 py-4 border-b border-gray-200 hover:bg-gray-50 transition-colors duration-150">
    <div className="font-medium text-gray-900 sticky left-0 bg-white">{feature}</div>
    {values.map((value, index) => (
      <div key={index} className="text-center">{value}</div>
    ))}
  </div>
);

const Pricing = () => {
  const [isAnnual, setIsAnnual] = useState(false);

  const plans = [
    {
      name: "Starter VPS",
      price: isAnnual ? 5 : 7,
      cpu: "1 vCPU",
      ram: "1 GB",
      storage: "25 GB SSD",
      transfer: "1 TB",
      backups: "Weekly",
      support: "Email",
    },
    {
      name: "Basic VPS",
      price: isAnnual ? 10 : 12,
      cpu: "2 vCPU",
      ram: "2 GB",
      storage: "50 GB SSD",
      transfer: "2 TB",
      backups: "Daily",
      support: "Email",
    },
    {
      name: "Pro VPS",
      price: isAnnual ? 20 : 25,
      cpu: "2 vCPU",
      ram: "4 GB",
      storage: "80 GB SSD",
      transfer: "3 TB",
      backups: "Daily",
      support: "24/7 Chat",
      isPopular: true,
    },
    {
      name: "Business VPS",
      price: isAnnual ? 40 : 50,
      cpu: "4 vCPU",
      ram: "8 GB",
      storage: "160 GB SSD",
      transfer: "4 TB",
      backups: "Hourly",
      support: "24/7 Phone & Chat",
    },
    {
      name: "Enterprise VPS",
      price: isAnnual ? 80 : 100,
      cpu: "8 vCPU",
      ram: "16 GB",
      storage: "320 GB SSD",
      transfer: "5 TB",
      backups: "Continuous",
      support: "Dedicated Support Team",
    },
    {
      name: "Custom VPS",
      price: "Custom",
      cpu: "Custom",
      ram: "Custom",
      storage: "Custom",
      transfer: "Custom",
      backups: "Custom",
      support: "Tailored Support",
    },
  ];

  return (
    <div className="bg-gray-50 min-h-screen py-12 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        <h1 className="text-5xl font-extrabold text-gray-900 text-center mb-8">
          Choose Your VPS Plan
        </h1>
        <div className="flex justify-center items-center gap-4 mb-8">
          <button
            onClick={() => setIsAnnual(false)}
            className={`px-4 py-2 rounded-l-md ${
              !isAnnual ? 'bg-indigo-600 text-white' : 'bg-gray-200 text-gray-700'
            } transition-colors duration-150`}
          >
            Monthly
          </button>
          <button
            onClick={() => setIsAnnual(true)}
            className={`px-4 py-2 rounded-r-md ${
              isAnnual ? 'bg-indigo-600 text-white' : 'bg-gray-200 text-gray-700'
            } transition-colors duration-150`}
          >
            Annual (Save 20%)
          </button>
        </div>
        <div className="bg-white shadow-xl rounded-lg overflow-hidden">
          <div className="overflow-x-auto">
            <div className="inline-block min-w-full align-middle">
              <div className="overflow-hidden">
                <div className="grid grid-cols-7 gap-4 p-6 bg-gray-100 sticky top-0">
                  <div className="font-semibold text-gray-900">Features</div>
                  {plans.map((plan, index) => (
                    <div key={index} className="text-center">
                      <h3 className="text-lg font-semibold text-gray-900">{plan.name}</h3>
                      <p className="text-3xl font-bold text-indigo-600 mt-2">
                        {plan.price === "Custom" ? (
                          "Custom"
                        ) : (
                          <>
                            ${plan.price}
                            <span className="text-base font-normal text-gray-500">/mo</span>
                          </>
                        )}
                      </p>
                      {plan.isPopular && (
                        <span className="inline-block bg-indigo-100 text-indigo-800 text-xs px-2 py-1 rounded-full uppercase font-semibold tracking-wide mt-2">
                          Most Popular
                        </span>
                      )}
                    </div>
                  ))}
                </div>
                <div className="divide-y divide-gray-200">
                  <FeatureRow feature="CPU" values={plans.map(p => p.cpu)} />
                  <FeatureRow feature="RAM" values={plans.map(p => p.ram)} />
                  <FeatureRow feature="Storage" values={plans.map(p => p.storage)} />
                  <FeatureRow feature="Transfer" values={plans.map(p => p.transfer)} />
                  <FeatureRow feature="Backups" values={plans.map(p => p.backups)} />
                  <FeatureRow feature="Support" values={plans.map(p => p.support)} />
                </div>
                <div className="grid grid-cols-7 gap-4 p-6 bg-gray-50">
                  <div></div>
                  {plans.map((plan, index) => (
                    <div key={index} className="text-center">
                      <button className="w-full bg-indigo-600 text-white rounded-md py-2 px-4 hover:bg-indigo-700 transition duration-150 ease-in-out transform hover:scale-105">
                        Select Plan
                      </button>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Pricing;
